import React, { Component } from 'react';
import BackBtn from '../BackBtn';
import Item from './Item'
import { Route, Switch, Redirect, Link } from 'react-router-dom';
import './index.css';
import Background2 from '../../background-img/search-box.png';
var sectionStyle2 = {
    // makesure here is String确保这里是一个字符串，以下是es6写法
    backgroundImage: `url(${Background2})`
};
export default class index extends Component {
    render() {
        return (
            <div className="content">
                <div className="content-top">
                    <a href=" ">我的班级</a>
=               <BackBtn />
                </div>

                <div className="student">
                    <div className="student-top">
                        <h3>折纸兴趣班</h3>
                        <div className="search-box">
                            <input type="text" placeholder="快速查找" />
                            <button style={sectionStyle2}></button>
                        </div>
                    </div>
                    <div className="showdata">
                        <div className="classify">
                            <div><Link to='/showclass/teacher/teacher'>所有老师(12)</Link></div>
                            <div><Link to='/showclass/student/student'>所有学生(12)</Link></div>
                            <div><Link to='/showclass/patriarch/patriarch'>所有家长(12)</Link></div>
                        </div>

                        <div className="item-wrapper">
                            {/* 注册路由 */}
                            <Switch>
                                <Route path='/showclass/teacher/:identity' component={Item} />
                                <Route path='/showclass/student/:identity' component={Item} />
                                <Route path='/showclass/patriarch/:identity' component={Item} />
                                {/* <Redirect to='/showclass/teacher/:identity'/> */}
                            </Switch>
                        </div>


                    </div>
                </div>



            </div>
        )
    }
}
